  "instrument": false,
  "reporter": [
    "lcov",
    "text-summary"
  ]
}

{
  "extends": "@parcel/config-default",
  "resolvers": ["@parcel/resolver-glob", "parcel-resolver-docs", "..."],
  "transformers": {
    "apiCheck:*.{js,ts,tsx,json}": ["parcel-transformer-docs"],
    "docs:*.{js,ts,tsx,json}": ["parcel-transformer-docs", "@parcel/transformer-inline"],
    "docs-json:*.{js,ts,tsx,json}": ["parcel-transformer-docs"],
    "extract:*.mdx": ["parcel-transformer-mdx-extract"],
    "packages/*/*/intl/*.json": ["parcel-transformer-intl"],
    "bundle-text:*.svg": ["@parcel/transformer-svg", "@parcel/transformer-inline-string"],
    "*.{md,mdx}": ["parcel-transformer-mdx-docs"],
    "*.svg": ["@parcel/transformer-svg-react"],
    "packages/@react-aria/example-theme/**/*.css": ["@parcel/transformer-css"],
    "*.css": ["...", "parcel-transformer-css-env"],
    "*.{js,mjs,jsm,jsx,es6,cjs,ts,tsx}": [
      "@parcel/transformer-js",
      "@parcel/transformer-react-refresh-wrap"
    ]
  },
  "namers": ["parcel-namer-docs", "..."],
  "packagers": {
    "*.json": "parcel-packager-docs",
    "*.html": "parcel-packager-ssg"
  },
  "optimizers": {
    "*.js": ["@parcel/optimizer-terser"],
    "**/spectrum-theme.cjs": ["parcel-optimizer-strict-mode"]
  }
}

{
  "extends": "@parcel/config-default",
  "resolvers": ["@parcel/resolver-glob", "parcel-resolver-build", "..."],
  "bundler": "@parcel/bundler-library",
  "transformers": {
    "style-types:*.ts": ["@parcel/transformer-typescript-types"],
    "packages/**/intl/*.json": ["parcel-transformer-intl"],
    "bundle-text:*.svg": ["@parcel/transformer-svg", "@parcel/transformer-inline-string"],
    "illustration:*.svg": ["@react-spectrum/parcel-transformer-s2-icon"],
    "packages/@react-spectrum/s2/{s2wf-icons,spectrum-illustrations}/**/*.svg": ["@react-spectrum/parcel-transformer-s2-icon"],
    // Disable PostCSS from running over style macro output
    "packages/@react-spectrum/s2/**/*.css": ["@parcel/transformer-css"],
    "*.svg": ["@parcel/transformer-svg-react"],
    "*.{js,mjs,jsm,jsx,es6,cjs,ts,tsx}": [
      "@parcel/transformer-js",
      "@parcel/transformer-react-refresh-wrap"
    ]
  },
  "namers": ["parcel-namer-s2", "parcel-namer-intl", "..."],
  "optimizers": {
    "**/spectrum-theme.cjs": ["parcel-optimizer-strict-mode"]
  }
}

{
  "extends": "@parcel/config-storybook",
  "resolvers": ["@parcel/resolver-glob", "..."],
  "transformers": {
    "packages/*/*/intl/*.json": ["parcel-transformer-intl"]
  }
}

{
  "presets": [
    "@babel/preset-typescript",
    "@babel/preset-react",
    ["@babel/preset-env",
      {
        "loose": true,
        "modules": false
      }
    ]
  ],
  "env": {
    "storybook": {
      "presets": [
        [
          "@babel/preset-env",
          {
            "loose": true,
            "targets": {
              "esmodules": true
            }
          }
        ]
      ]
    },
    "cover": {
      "plugins": [
        "istanbul"
      ]
    },
    "production": {
      "plugins": [
        [
          "react-remove-properties",
          {
            "properties": [
              "data-testid"
            ]
          }
        ]
      ]
    }
  },
  "plugins": [
    [
      "@babel/plugin-transform-runtime",
