        "version": "^7.6.2"
      }
    ],
    [
      "@babel/plugin-proposal-decorators",
      {
        "legacy": true
      }
    ],
    "transform-glob-import",
    "babel-plugin-macros"
  ],
  "sourceType": "unambiguous"
}

